import React, {Component} from 'react';

class Rank extends Component{
  constructor() {
    super();
    this.state = {
      leaderboard: {test: "test"},
      scores: {test: "test"},
      attempts: 0,
      max_score: 0
    };
    // this.onSubmit = this.onSubmit.bind(this);
    // this.handleChange = this.handleChange.bind(this);
  }

  componentDidMount(){
    fetch(`http://localhost:3001/questions/`)
      .then(response => response.json())
      .then(data => {
        console.log(data);
        // this.setState({
        //   questions: data
        // })
      });
  }

  // this.setState({imageUrl: this.state.input});
  //     fetch('http://localhost:3001/imageurl', {
  //       method: 'post',
  //       headers: {'Content-Type': 'application/json'},
  //       body: JSON.stringify({
  //         input: this.state.input
  //       })
  //     })
  //     .then(response => response.json())
  //     .then(response => {
  //       if (response) {
  //         fetch('http://localhost:3001/image', {
  //           method: 'put',
  //           headers: {'Content-Type': 'application/json'},
  //           body: JSON.stringify({
  //             id: this.state.user.id
  //           })
  //         })
  //           .then(response => response.json())
  //           .then(count => {
  //             this.setState(Object.assign(this.state.user, { entries: count}))
  //           })
  //           .catch(console.log)

  //       }
  //       this.displayFaceBox(this.calculateFaceLocation(response))
  //     })
  //     .catch(err => console.log(err));

  render() {
    const {user} = this.props;
    const {leaderboard, scores, attempts, max_score} = this.state;

    return (
      <div className="pa4">
        {
          Object.keys(this.state.leaderboard).length === 0
          ? <h3 className='mt4 mb4'> Loading Leaderboard ... </h3>
          : (        
            <div className="overflow-auto mb4">
              <h3> Top 10 Leaderboard </h3>
              <table className="f6 w-100 mw8" cellSpacing="0">
               <thead>
                  <tr className="stripe-dark">
                    <th className="fw6 pa3 bg-red">Rank</th>
                    <th className="fw6 pa3 bg-red">Username</th>
                    <th className="fw6 pa3 bg-red">Attempts</th>
                    <th className="fw6 pa3 bg-red">Max Score</th>
                  </tr>
                </thead>
                <tbody className="lh-copy">
                  <tr className="stripe-dark">
                    <td className="pa3">Hassan Johnson</td>
                    <td className="pa3">@hassan</td>
                    <td className="pa3">hassan@companywithalongdomain.co</td>
                    <td className="pa3">14419232532474</td>
                  </tr>
                </tbody>
              </table>
            </div>
          )
        }

        {
          Object.keys(this.state.scores).length === 0
          ? <h3 className='mt4 mb4'> Loading Previous Scores ... </h3>
          : (
            <div className="overflow-auto">
              <h3> {`${user.name}'s Last 5 Attempts out of ${attempts} Attempts`} </h3>
              <h4> {`With ${user.name}'s Current Highest Score being ${max_score}`} </h4>
              <table className="f6 w-100 mw8" cellSpacing="0">
               <thead>
                  <tr className="stripe-dark">
                    <th className="fw6 pa3 bg-orange">Score</th>
                  </tr>
                </thead>
                <tbody className="lh-copy">
                  <tr className="stripe-dark">
                    <td className="pa3">@hassan</td>
                  </tr>
                </tbody>
              </table>
            </div>
          )
        }
      </div>
    );
  }
}

export default Rank;
